  input: '"TEXT","F3XA","C00399246","This report responds to your RQ-2 dated November
    24.   We are sending, under separate cover, a letter outlining our procedures
    for collecting occupation and employer information from our donors.  We experienced
    some data import problems, which caused our receipts to be inflated in the original
    report.  This also affects the two individuals whose contributions look excessive.  However,
    one is not excessive when the data problems were corrected, and the other was
    erroneously entered into a joint record when it should have been split into two,
    one each for Mr. and Mrs. Davis.  This has been corrected.  All vendor addresses
    have been entered, and the purpose of the expenditures have been clarified to
    indicate all expenditures were the result of fundraising for SUPA."'
